  const [search, setSearch] = useState('')
  const [show, setShow] = useState(false)
  const [user, setUser] = useState('')

  return (
    <div className="App">
      <header className="header">
       <Logo />
       <Buscar setSearch={setSearch} />
       <Sesion show={show} setShow={setShow} setUser={setUser} />
      </header>
      <aside className='aside'>

      </aside>
      <main className='main'>
        {search?<Products products={search}/>: <Products products={[{name:'hola'}, {name: 'quetal'}, {name:'buenas'}]} />}
      </main>
      <footer className='footer'>+

      </footer>
    </div>
  );
}

export default App;
